// CameraFeeds.js
import React from 'react';
import Camera from './camera';

const cameraUrls = [
  'https://gatewatcher.dopple.site/camera_front',
  'https://gatewatcher.dopple.site/camera_back',
  'https://gatewatcher.dopple.site/camera_left',
  'https://gatewatcher.dopple.site/camera_right',
  'https://gatewatcher.dopple.site/camera_top'
];

const CameraFeeds = () => {
  const activeCameras = cameraUrls.slice(0, 4); // Adjust the number of active cameras as needed

  return (
    <div style={{ display: 'flex', flexWrap: 'wrap', gap: '10px' }}>
      {activeCameras.map((url, index) => (
        <Camera key={index} url={url} />
      ))}
    </div>
  );
};

export default CameraFeeds;
